-- Create date: 28/08/2022
-- Description:	SP for Read, Create, Update and Delete of Scheme
-- =============================================
CREATE PROCEDURE [dbo].[EM_Scheme] 
	@Id int =0,
	@SchemeName nvarchar(max) = null,
	@SchemeDuration int = 0,
	@DiscountPercentage int = 0,
	@Amount int = 0,
	@AmountPaid int = 0,
	@Rental bit = 0,
	@Tenant bit = 0,
	@Action int = 0
AS
BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;

    -- Insert statements for procedure here
	IF (@Action = 0) -- READ
	BEGIN
	SELECT * FROM Scheme 
	END
	ELSE IF (@Action = 1) -- CREATE
	BEGIN
		INSERT INTO Scheme(
		SchemeName,
		SchemeDuration,
		DiscountPercentage,
		Amount,
		Rental,
		Tenant) 
		values(
		@SchemeName,
		@SchemeDuration,
		@DiscountPercentage,
		@Amount,
		@Rental,
		@Tenant)
	END
	ELSE IF (@Action = 2) -- Update
	BEGIN
		UPDATE Scheme set
		SchemeName = @SchemeName,
		SchemeDuration = @SchemeDuration,
		DiscountPercentage = @DiscountPercentage,
		Amount = @Amount,
		Rental = @Rental,
		Tenant = @Tenant
		WHERE Scheme.Id = @Id
	END
	ELSE IF (@Action = 3) -- Delete
	BEGIN
		DELETE from Scheme 
		WHERE Scheme.Id = @Id
	END
END
GO
